import * as cheerio from 'cheerio';
import { Frame, ErrorKeys } from './types.js';

/**
 * @returns a { frame: Frame | null, errors: null | ErrorMessages } object, extracting the frame metadata from the given htmlString.
 * If the Frame fails validation, the `errors` object will be non-null
 */
declare function validateFrame({ htmlString, url, }: {
    htmlString: string;
    url: string;
}): {
    frame: Frame | null;
    errors: null | Record<ErrorKeys[number], string[]>;
};
declare function parseButtonElement(elem: cheerio.Element): {
    buttonIndex: number;
    content: string | undefined;
} | null;

export { parseButtonElement, validateFrame };
